import React, { Component } from 'react';
import './App.css';
import Card from './Card/Card';
import Summary from './Summary/Summary';

class App extends Component {
  render(){
    const style = {
      padding: '100px'
    }

  return (
    <div className="App">
    <h1 style={style}>Hello, NEW APP</h1>
    <Card name='Terry'/>
    <h1></h1>
    <Summary/>
    </div>
  );
}
}

export default App;
